        { id: 2, value: 5 },
        { id: 3, value: 6 },
      ],
    };
  }
  render() {
    return (<h1>Hello you

         {counters.map((counter)=>{
            <div className='content' key={id}>
                {counter}
            </div>
         })}






    </h1>);
  }
}

